// Test script for the fixed polling integration
const axios = require('axios');

const BACKEND_URL = 'http://localhost:3001';

async function testBackendHealth() {
  try {
    const response = await axios.get(`${BACKEND_URL}/api/health`);
    console.log('‚úÖ Backend is healthy');
    return true;
  } catch (error) {
    console.error('‚ùå Backend is not accessible:', error.message);
    return false;
  }
}

async function testMusicGeneration() {
  try {
    console.log('üéµ Testing music generation...');

    const testDeviceId = `test-device-${Date.now()}`;
    const testImageBase64 = '';

    const response = await axios.post(`${BACKEND_URL}/api/scene/analyze`, {
      imageBase64: testImageBase64,
      deviceId: testDeviceId,
      timestamp: new Date().toISOString(),
      mimeType: 'image/jpeg',
      userId: 'test-user'
    });

    if (response.data.success && response.data.sceneChanged) {
      console.log('‚úÖ Music generation successful');
      console.log('- Music URL:', response.data.musicUrl ? '‚úÖ Present' : '‚ùå Missing');
      console.log('- Title:', response.data.title);
      console.log('- Scene Description:', response.data.sceneDescription?.substring(0, 50) + '...');
      console.log('- Make Instrumental:', response.data.makeInstrumental);
      return { deviceId: testDeviceId, success: true };
    } else {
      console.log('‚ùå Music generation failed or scene unchanged');
      return { deviceId: testDeviceId, success: false };
    }

  } catch (error) {
    console.error('‚ùå Music generation failed:', error.response?.data?.error || error.message);
    return { success: false };
  }
}

async function testMusicRetrieval(deviceId) {
  try {
    console.log('üé∂ Testing music retrieval...');

    const response = await axios.get(`${BACKEND_URL}/api/music/latest/${deviceId}`);

    if (response.data.success && response.data.hasMusic) {
      console.log('‚úÖ Music retrieval successful');
      console.log('- Title:', response.data.title);
      console.log('- Music URL:', response.data.musicUrl ? '‚úÖ Present' : '‚ùå Missing');
      console.log('- Scene Description:', response.data.sceneDescription?.substring(0, 50) + '...');
      console.log('- Make Instrumental:', response.data.makeInstrumental);
      console.log('- Retrieved At:', response.data.retrievedAt);
      return true;
    } else {
      console.log('‚ùå No music found or retrieval failed');
      return false;
    }

  } catch (error) {
    console.error('‚ùå Music retrieval failed:', error.response?.data?.error || error.message);
    return false;
  }
}

async function testMusicStats() {
  try {
    console.log('üìä Testing music stats...');

    const response = await axios.get(`${BACKEND_URL}/api/music/stats`);

    if (response.data.success) {
      console.log('‚úÖ Music stats retrieved');
      console.log('- Total Devices:', response.data.stats.totalDevices);
      console.log('- Total Music:', response.data.stats.totalMusic);
      console.log('- Devices:', response.data.stats.devices.join(', '));
      return true;
    } else {
      console.log('‚ùå Music stats failed');
      return false;
    }

  } catch (error) {
    console.error('‚ùå Music stats failed:', error.message);
    return false;
  }
}

